  render(){
  return (
    <div className="about">
        <p>OUR BELOVED TEACHER</p>
        <div className="row">
          <div className="col-4">
            <img src='http://localhost:4000/anh/thay' className="thay"></img>
          </div>
          <div className="col-8">
            <p>Our thank you letter</p>
            <p></p>
          </div>
        </div>
    </div>
  );
}}

export default About;
